var handleDataTableKeyTable = function(){
	"use strict";
	0!==$("#remain-tbl").length&&$("#remain-tbl").DataTable({
			scrollY:300,
			paging:!1,
			autoWidth:!0,
			keys:!0,
			responsive:!0}
		)},
	TableManageKeyTable = function(){
		"use strict";
		return {
			init:function()
			{
				handleDataTableKeyTable()
			}
		}
}();


